import React, {useState, useEffect} from "react";
import axios from "axios";

const Axios = () =>{
  const [dogs, setDogs] = useState([]);

  useEffect(()=>{
    axios.all([axios.get(`/api/breads/image/random`)])
    .then(
      axios.spread((dog) => {
        const dogs = dog.data;
        setDogs(dogs);
      })
    );
  }, []);

  return(
    <div>
      <ul>
        {dogs.message}
        {<img src={dogs.message} alt={dogs.message} />}
      </ul>
    </div>
  );


}




export default Axios
